import React from "react";
import Col from "react-bootstrap/Col";

const ProductCard = () => {
    return (
        <Col class="md={4}">
            <div class="card p-3 my-2 bg-light rounded">
                <div class="card-img">
                    <img
                        src="https://res.cloudinary.com/dsip2gx3i/image/upload/v1623699422/CPR%20-%20Calibras/mannequin-3.jpg"
                        class="img-fluid rounded w-75"
                        alt="cpr"
                    />
                </div>
                <div class="card-body">
                    <h3 class="fw-bold fs-2">First Aid CPR/AED</h3>
                    <ul>
                        <li class="py-1 fw-bold">Teachers</li>
                        <li class="py-1 fw-bold">Fitness/Health Trainers</li>
                        <li class="py-1 fw-bold">All Hotel Staff</li>
                        <li class="py-1 fw-bold">Sport Coaches & Staff</li>
                    </ul>
                    <a href="book.html" class="btn btn-danger mt-3">
                        Schedule Now
                    </a>
                </div>
            </div>
        </Col>
    );
};

export default ProductCard;
